import React from 'react';
import '../App.css';
import api from '../api'

export class Cups extends React.Component {
    constructor(props) {
        super(props);
        this.state = { products: [] };
    }

    async componentDidMount() {
        await api.getAllProducts().then(products => {
            this.setState({
                products: products.data,
            })
        })
    }
    render() {
        return (
            <div>
                {/* <h1></h1> */}
                {this.state.products.map((product, i) => (
                    <h2 key={i}>
                        {product.name}
                        {product.type}
                        {product.picture}
                        {product.price}
                    </h2>
                ))}
            </div>
        )
    }
}

export default Cups;
